import React from 'react';
import './App.css';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';



function App() {
  return (
    <Router>
    <div className="app">
      <Routes>

      <Route path="/">
         <Header />
         <Home />
        </Route>

        <Route path="/checkout">
        <Header />
        <h1>Hi howareyou</h1>
        </Route>
      </Routes>
      </div>
    </Router>
  );
}

export default App;
